/* 还记得一切开始的时候 */
function setFilter(cmt)
{
	var gf1=$.createGlowFilter(Utils.rgb(112,319,317)/*光晕颜色*/,0.5/*Alpha*/,7/*水平模糊量*/,7/*垂直模糊量*/,4/*印记或跨页的强度*/,3/*应用滤镜的次数*/,true/*是否为内侧发光*/,false/*是否具有挖空效果*/);
	var cmtf = cmt.getTextFormat(0,1);cmtf.bold=false/*粗体*/;cmtf.font="幼圆"/*字体*/;cmt.setTextFormat(cmtf,0,1);cmt.filters=[gf1];
}
/* 逐条执行-渐隐 */
function DanmakuAlpha(String,Xposition,Yposition,Vtime,Vhue,Vstep,Valpha,Vsize,Vspeed,Vdistance,Vetime)
{
var Str = String;
Len = Str.length;
Vcolor = Utils.hue(Vhue);
var i = 0;
interval(function(){
i++;
Sub = Str.substring(i-1,i);
var cmt = $.createComment(Sub,{ motionGroup:[
	{alpha:{ fromValue:0, toValue:1,lifeTime:0.5}},
	{alpha:{fromValue:1,toValue:1,lifeTime:2.5}},
	{alpha:{fromValue:1,toValue:0,lifeTime:0.5}}
	],
	x:Xposition+i*Vsize/Vdistance,y:Yposition,
	fontsize:Vsize,
 	lifeTime:Vtime-(i-1)*Vspeed/1000+2.5, 
 	color:0xffffff,

 });
setFilter(cmt);
},Vspeed,Len);

}

DanmakuAlpha('还记得一切开始的时候',20,316,6.5,120,50,1,30,100,1,0.6);

