function setWorldLine(cmt){	var gf1=$.createGlowFilter(0xff0000,0.9,16,16,2,1,false,false);	var cmtf = cmt.getTextFormat(0,1);cmtf.bold=false;cmt.setTextFormat(cmtf,0,1);cmt.filters=[gf1];}function extendToDisappear(String,Xposition,Yposition,Vcolor,Vstep,Vsize,Vdistance,Vapptime,Vstaytime,Vdistime,Vextend,Vfilter){	var Str = String;	Len = Str.length;	for (var i = 1;i<Len+1;i++)		{								Sub = Str.substring(i-1,i);				var cmt_1 = $.createComment(Sub,{ 							motionGroup:[									{alpha:{fromValue:0,toValue:1,lifeTime:Vapptime}},									{alpha:{fromValue:1,toValue:1,lifeTime:Vstaytime}},								    	{alpha:{fromValue:1,toValue:0,lifeTime:Vdistime},x:{fromValue:Xposition,toValue:Xposition+(i-0.5-Len/2)*Vextend,lifeTime:Vdistime}}								     ],							x:Xposition,							y:Yposition,							lifeTime: Vapptime+Vstaytime+Vdistime, 							color:Vcolor,							fontsize:Vsize   			  			      }						  );				Vcolor = Vcolor + Vstep;                                Xposition = Xposition+(Vsize/Vdistance);								switch (Vfilter) { 						case 0:     						break;  						case 1: cmt_1.filters = null;    						break;  						case 2: setWorldLine(cmt_1);    						break;					    }						}			}extendToDisappear('我     ',90,170,0xffffff,-0x000000,60,1,1,1,4,30,2);


